inline fun <Main : BasicScreen> Navigation(modifier: Modifier = Modifier.fillMaxSize(), deeplink: DeepLink = DeepLink.Default, noinline transitionSpecProvider: AnimatedContentTransitionScope<*>.() -> ContentTransform = {
                slideIntoContainer(
                    towards = AnimatedContentTransitionScope.SlideDirection.Start,
                    animationSpec = tween(durationMillis = 400)
                ) togetherWith slideOutOfContainer(
                    towards = AnimatedContentTransitionScope.SlideDirection.End,
                    animationSpec = tween(durationMillis = 400)
                )
            }, crossinline builder: ScreenMap.() -> Unit)

